더하는 과정을 4개의 영역으로 나누어서 진행합니다. 나누는 기준은 가로와 세로를 절반씩 나누어서 4개의 영역을 만드는 방식입니다.
Add(Ri1, Ci1, Ri2, Ci2, Vi)
= Add(Ri1, Ci1, |Ri1+Ri2/2|, |Ci1+Ci2/2|) + Add(Ri1, |Ci1+Ci2/2|+1, |Ri1+Ri2/2|, Ci2) + Add(|Ri1+Ri2/2|+1, Ci1, Ri2, |Ci1+Ci2/2|) + Add(|Ri1+Ri2/2|+1, |Ci1+Ci2/2|+1, Ri2, Ci2)
이렇게 하다가 크기가 1이면 바로 Vi를 더하는 방식으로 하면, 이 명령이 lgn번 실행되었을 때 모든 행렬이 채워지게 됩니다. 따라서 V0부터 Vn까지 nlgn번 실행하면 다 채워넣게 됩니다.
def Add(R1, R2, C1, C2, V):
	if (R1 == R2) and (C1 == C2)
		A[R1][C1] := A[R1][C1] + Vi;
	else if (R1 == R2) and (C1 != C2)
		Add(R1, R2, C1, |C1+C2/2|)
		Add(R1, R2, |C1+C2/2|+1, C2)
	else if (R1 != R2) and (C1 == C2)
		Add(R1, |R1+R2/2|, C1, C2)
		Add(|R1+R2/2|+1, R2, C1, C2)
	else:
		Add(R1, |R1+R2/2|, C1, |C1+C2/2|)
		Add(R1, |R1+R2/2|, |C1+C2/2|+1, C2)
		Add(|R1+R2/2|+1, R2, C1, |C1+C2/2|)
		Add(|R1+R2/2|+1, R2, |C1+C2/2|+1, C2)
for i := 1 to N do
	read (Ri1, Ri2, Ci1, Ci2, Vi);
	Add(Ri1, Ri2, Ci1, Ci2, Vi);
end
